import React, { Component } from "react";
import "../style/style.css";

export class main extends Component {
  render() {
    return (
      <div className="main_container">
        <div className="welcome">
          <h3>Welcome</h3>
          <p></p>
        </div>
      </div>
    );
  }
}

export default main;
